This is the balancing item in the list in which it is being used. 

Record any fee income or commission associated with the activities of the reporting party other than those related to:

- lending;
- deposit-taking;
- funds management;
- broking;
- underwriting;
- syndication;
- corporate advisory; or
- securitisation.

This is a balancing item in the list in which it is being used.

This is the value of all other income recognised in the profit or loss during the relevant period, as required on APRA form GRF_310_0_G.

This item represents income that is not:
- investment income;
- contained within the underwriting result;
- net foreign exchange gains;
- negative goodwill;
- defined benefit actuarial gains; or
- gains from non-current assets and disposal groups classified as held for sale not qualifying as discontinued operations.

This is the balancing item in the list in which it is being used.

This is the value of unrealised gains or losses from the revaluation of assets other than;

- securities and derivatives;
- plant and equipment;
- investment property;
- investment in related parties; and 
- intangibles.
